import React from 'react';

import frameImg from './frame.png';
import cupImg from './coffee.png';
const QR2 = () => {
  return (
    <div style={styles.container}>
      <div style={styles.message}>人生年表を生成中...</div>
    </div>
  );
};

const styles = {
  container: {
    width: '100%',
    height: '100%',
    backgroundColor: 'black',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  message: {
    color: 'white',
    fontSize: '2rem',
    textAlign: 'center',
  },
};

export default QR2;
